type Light struct {
	direction Vec3
}

func lightApplyIntensity(originalColor uint32, percentageFactor float64) uint32 {
	if percentageFactor < 0 {
		percentageFactor = 0
	}
	if percentageFactor > 1 {
		percentageFactor = 1
	}

	a := originalColor & 0xFF000000
	r := uint32(float64(originalColor&0x00FF0000) * percentageFactor)
	g := uint32(float64(originalColor&0x0000FF00) * percentageFactor)
	b := uint32(float64(originalColor&0x000000FF) * percentageFactor)

	newColor := a | (r & 0x00FF0000) | (g & 0x0000FF00) | (b & 0x000000FF)
	return newColor
}

type Tex2 struct {
	u, v float64
}

type Camera struct {
	position        Vec3
	direction       Vec3
	forwardVelocity Vec3
	yaw             float64
	pitch           float64
}

func (c Camera) getLookAtTarget() Vec3 {
	// Initialize the target looking at the positive z-axis
	target := Vec3{0, 0, 1}
	cameraYawRotation := RotateY(camera.yaw)
	cameraPitchRotation := RotateX(camera.pitch)

	// Create camera rotation matrix based on yaw and pitch
	cameraRotation := Identity4()
	cameraRotation = cameraPitchRotation.mul(cameraRotation)
	cameraRotation = cameraYawRotation.mul(cameraRotation)

	// Update camera direction based on the rotation
	camera.direction = cameraRotation.mulv(target.v4()).v3()

	// Offset the camera position in the direction where the camera is pointing at
	target = camera.position.add(camera.direction)

	return target
}

// Initial SDL
func initial() bool {
	var err error
	if err = sdl.Init(sdl.INIT_EVERYTHING); err != nil {
		fmt.Fprintf(os.Stderr, "failed to initialize SDL: %s\n", err)
		return false
	}

	// Use SDL to query what is the fullscreen max width and height
	displayMode, _ := sdl.GetCurrentDisplayMode(0)
	fullscreenWidth := displayMode.W
	fullscreenHeight := displayMode.H

	windowWidth = fullscreenWidth / 2
	windowHeight = fullscreenHeight / 2

	// Create a SDL window
	window, err = sdl.CreateWindow("", sdl.WINDOWPOS_CENTERED, sdl.WINDOWPOS_CENTERED,
		fullscreenWidth, fullscreenHeight, sdl.WINDOW_BORDERLESS)
	if err != nil {
		fmt.Fprintf(os.Stderr, "failed to create SDL window: %s\n", err)
		return false
	}

	// Create a SDL renderer
	renderer, err = sdl.CreateRenderer(window, -1, 0)
	if err != nil {
		fmt.Fprintf(os.Stderr, "failed to create renderer: %s\n", err)
		return false
	}

	// window.SetFullscreen(sdl.WINDOW_FULLSCREEN)

	return true
}

// Setup function to initialize variables and game objects
func setup() (err error) {
	// Initialize render mode and triangle culling method
	renderMethod = RENDER_WIRE
	cullMethod = CULL_BACKFACE

	// Allocate the required memory in bytes to hold the color buffer and the z-buffer
	colorBuffer = make([]uint32, windowWidth*windowHeight)
	zbuffer = make([]float64, windowWidth*windowHeight)

	// Creating a SDL texture that is used to display the color buffer
	colorBufferTexture, err = renderer.CreateTexture(
		uint32(sdl.PIXELFORMAT_RGBA32),
		sdl.TEXTUREACCESS_STREAMING,
		windowWidth,
		windowHeight)

	if err != nil {
		return fmt.Errorf("failed to creat texture: %s", err)
	}

	// Initialize the perspective projection matrix
	aspectY := float64(windowHeight) / float64(windowWidth)
	aspectX := float64(windowWidth) / float64(windowHeight)
	fovY := math.Pi / 3.0 // the same as 180/3, or 60deg
	fovX := math.Atan(math.Tan(fovY/2)*aspectX) * 2

	znear := 1.0
	zfar := 20.0
	projMatrix = Perspective(fovY, aspectY, znear, zfar)

	// Initialize frustum planes with a point and a normal
	frustumPlanes = initFrustumPlanes(fovX, fovY, znear, zfar)

	err = LoadMesh(filepath.Join(parentpath, "assets", "f22.obj"), filepath.Join(parentpath, "assets", "f22.png"), Vec3{1, 1, 1}, Vec3{-3, 0, 8}, Vec3{0, 0, 0})
	if err != nil {
		return fmt.Errorf("failed to load model: %s", err)
	}
	err = LoadMesh(filepath.Join(parentpath, "assets", "efa.obj"), filepath.Join(parentpath, "assets", "efa.png"), Vec3{1, 1, 1}, Vec3{3, 0, 8}, Vec3{0, 0, 0})
	if err != nil {
		return fmt.Errorf("failed to load model: %s", err)
	}
	return nil
}

// Poll system events and handle keyboard input
func processInput() {
	for event := sdl.PollEvent(); event != nil; event = sdl.PollEvent() {
		switch t := event.(type) {
		case *sdl.QuitEvent:
			println("Quit")
			isRunning = false
		case *sdl.KeyboardEvent:
			switch t.Type {
			case sdl.KEYDOWN:
				switch t.Keysym.Sym {
				case sdl.K_ESCAPE:
					isRunning = false
				case sdl.K_1:
					renderMethod = RENDER_WIRE_VERTEX
				case sdl.K_2:
					renderMethod = RENDER_WIRE
				case sdl.K_3:
					renderMethod = RENDER_FILL_TRIANGLE
				case sdl.K_4:
					renderMethod = RENDER_FILL_TRIANGLE_WIRE
				case sdl.K_5:
					renderMethod = RENDER_TEXTURED
				case sdl.K_6:
					renderMethod = RENDER_TEXTURED_WIRE
				case sdl.K_c:
					cullMethod = CULL_BACKFACE
				case sdl.K_x:
					cullMethod = CULL_NONE
				case sdl.K_w:
					camera.pitch += 3.0 * deltaTime
				case sdl.K_s:
					camera.pitch -= 3.0 * deltaTime
				case sdl.K_RIGHT:
					camera.yaw += 1.0 * deltaTime
				case sdl.K_LEFT:
					camera.yaw -= 1.0 * deltaTime
				case sdl.K_UP:
					camera.forwardVelocity = camera.direction.muln(5.0 * deltaTime)
					camera.position = camera.position.add(camera.forwardVelocity)
				case sdl.K_DOWN:
					camera.forwardVelocity = camera.direction.muln(5.8 * deltaTime)
					camera.position = camera.position.sub(camera.forwardVelocity)
				}
			}
		}
	}
}

// Update function frame by frame with a fixed time step
func update() {
	// Wait some time until the reach the target frame time in milliseconds
	timeToWait := FRAME_TARGET_TIME - (sdl.GetTicks64() - previousFrameTime)

	// Only delay execution if we are running too fast
	if timeToWait > 0 && timeToWait <= FRAME_TARGET_TIME {
		sdl.Delay(uint32(timeToWait))
	}

	// Get a delta time factor converted to seconds to be used to update our game objects
	deltaTime = float64(sdl.GetTicks64()-previousFrameTime) / 1000.0

	previousFrameTime = sdl.GetTicks64()

	// Initialize the counter of triangles to render for the current frame
	numTrianglesToRender = 0

	// Loop all the meshes of our scene
	for meshIndex := range meshCount {
		mesh := meshes[meshIndex]

		// Change the mesh scale, rotation and translation values per animation frame
		// mesh.rotation[0] -= 0.2 * deltaTime
		// mesh.rotation = mesh.rotation.addn(0.6 * deltaTime)
		// mesh.scale[0] += 0.002
		// mesh.scale[1] += 0.001
		// mesh.translation[0] += 0.01
		// mesh.translation[2] = 4

		// Update camera look at target to create view matrix
		target := camera.getLookAtTarget()

		// Offset the camera position in the direction where the camera is pointing at
		upDirection := Vec3{0, 1, 0}

		// Create the view matrix
		viewMatrix := LookAt(camera.position, target, upDirection)

		// Create a scale, rotation and translation matrices that will be used to multiply the mesh vertices
		scaleMatrix := Scale(mesh.scale)
		translationMatrix := Translation(mesh.translation)
		rotationMatrixX := RotateX(mesh.rotation.x())
		rotationMatrixY := RotateY(mesh.rotation.y())
		rotationMatrixZ := RotateZ(mesh.rotation.z())

		// Create a World Matrix combining scale, rotation, and translation matrices
		worldMatrix := Identity4()
		// Order matters: First scale, then rotate, then translate. [T]*[R]*[S]*v
		worldMatrix = scaleMatrix.mul(worldMatrix)
		worldMatrix = rotationMatrixZ.mul(worldMatrix)
		worldMatrix = rotationMatrixY.mul(worldMatrix)
		worldMatrix = rotationMatrixX.mul(worldMatrix)
		worldMatrix = translationMatrix.mul(worldMatrix)

		// Loop all triangle faces of our mesh
		for i := range len(mesh.faces) {
			meshFace := mesh.faces[i]

			var faceVertices [3]Vec3
			faceVertices[0] = mesh.vertices[meshFace.a-1]
			faceVertices[1] = mesh.vertices[meshFace.b-1]
			faceVertices[2] = mesh.vertices[meshFace.c-1]

			var transformedVertices [3]Vec4

			// Loop all three vertices of this current face and apply transformations
			for j := range 3 {
				transformedVertex := faceVertices[j].v4()

				// Multiply the world matrix by the original vector
				transformedVertex = worldMatrix.mulv(transformedVertex)

				// Multiply the view matrix by the vector to transform the scene to camera space
				transformedVertex = viewMatrix.mulv(transformedVertex)

				// Save transformed vertex in the array of transformed vertices
				transformedVertices[j] = transformedVertex
			}

			// Check backface culling
			vectorA := transformedVertices[0].v3() /*   A   */
			vectorB := transformedVertices[1].v3() /*  / \  */
			vectorC := transformedVertices[2].v3() /* C---B */

			// Get the vector subtraction of B-A and C-A
			vectorAB := vectorB.sub(vectorA)
			vectorAC := vectorC.sub(vectorA)
			vectorAB = vectorAB.normalize()
			vectorAC = vectorAC.normalize()

			// Compute the face normal (using cross product to find perpendicular)
			normal := vectorAB.cross(vectorAC)
			normal = normal.normalize()

			// Find the vector between vertex A in the triangle and the camera origin
			origin := Vec3{0, 0, 0}
			cameraRay := origin.sub(vectorA)

			// Calculate how aligned the camera ray is with the face normal (using dot product)
			dotNormalCamera := normal.dot(cameraRay)

			// Backface culling test to see if the current face should be projected
			if cullMethod == CULL_BACKFACE {
				// Bypass the triangles that are looking away from the camera
				if dotNormalCamera < 0 {
					continue
				}
			}

			// Create a polygon from the original transformed triangle to be clipped
			polygon := createPolygonFromTriangle(
				transformedVertices[0].v3(),
				transformedVertices[1].v3(),
				transformedVertices[2].v3(),
				meshFace.auv,
				meshFace.buv,
				meshFace.cuv,
			)

			// Clip the polygon and returns a new polygon with potential new vertices
			polygon.clip()

			// Break the clipped polygon apart back into individual triangles
			trianglesAfterClipping, numTrianglesAfterClipping := polygon.triangles()

			// Loops all the assembled triangles after clipping
			for t := range numTrianglesAfterClipping {
				triangleAfterClipping := trianglesAfterClipping[t]

				var projectedPoints [3]Vec4

				// Loop all three vertices to perform projection and conversion to screen space
				for j := range 3 {
					// Project the current vertex using a perspective projection matrix
					projectedPoints[j] = projMatrix.mulv(triangleAfterClipping.points[j])

					// Perform perspective divide
					if projectedPoints[j].w() != 0 {
						projectedPoints[j] = projectedPoints[j].PerspectiveDivide()
					}

					// Flip vertically since the y values of the 3D mesh grow bottom->up and in screen space y values grow top->down
					projectedPoints[j][1] *= -1

					// Scale into the view
					projectedPoints[j][0] *= float64(windowWidth) / 2
					projectedPoints[j][1] *= float64(windowHeight) / 2

					// Translate the projected points to the middle of the screen
					projectedPoints[j][0] += float64(windowWidth) / 2
					projectedPoints[j][1] += float64(windowHeight) / 2
				}

				// Calculate the shade intensity based on how aliged is the face normal and the opposite of the light direction
				lightIntensityFactor := -normal.dot(light.direction)

				// Calculate the triangle color based on the light angle
				triangleColor := lightApplyIntensity(meshFace.color, lightIntensityFactor)

				// Create the final projected triangle that will be rendered in screen space
				triangleToRender := Triangle{
					points:    projectedPoints,
					texcoords: triangleAfterClipping.texcoords,
					color:     triangleColor,
					img:       mesh.img,
				}

				// Save the projected triangle in the array of triangles to render
				if numTrianglesToRender < MAX_TRIANGLES {
					trianglesToRender[numTrianglesToRender] = triangleToRender
					numTrianglesToRender++
				}
			}
		}
	}

}

// Render function to draw objects on the display
func render() {
	// Clear all the arrays to get ready for the next frame
	clearColorBuffer(0xFF000000)
	clearZBuffer()

	drawGrid()

	// // Loop all projected triangles and render them
	for i := range numTrianglesToRender {
		triangle := trianglesToRender[i]

		// Draw filled triangle
		if renderMethod == RENDER_FILL_TRIANGLE || renderMethod == RENDER_FILL_TRIANGLE_WIRE {
			drawFilledTriangle(
				int32(triangle.points[0].x()), int32(triangle.points[0].y()), triangle.points[0].z(), triangle.points[0].w(), // vertex A
				int32(triangle.points[1].x()), int32(triangle.points[1].y()), triangle.points[1].z(), triangle.points[1].w(), // vertex B
				int32(triangle.points[2].x()), int32(triangle.points[2].y()), triangle.points[2].z(), triangle.points[2].w(), // vertex C
				triangle.color,
			)
		}

		// Draw textured triangle
		if renderMethod == RENDER_TEXTURED || renderMethod == RENDER_TEXTURED_WIRE {
			drawTexturedTriangle(
				int32(triangle.points[0].x()), int32(triangle.points[0].y()), triangle.points[0].z(), triangle.points[0].w(), triangle.texcoords[0].u, triangle.texcoords[0].v, // vertex A
				int32(triangle.points[1].x()), int32(triangle.points[1].y()), triangle.points[1].z(), triangle.points[1].w(), triangle.texcoords[1].u, triangle.texcoords[1].v, // vertex B
				int32(triangle.points[2].x()), int32(triangle.points[2].y()), triangle.points[2].z(), triangle.points[2].w(), triangle.texcoords[2].u, triangle.texcoords[2].v, // vertex C
				triangle.img,
			)
		}

		// Draw triangle wireframe
		if renderMethod == RENDER_WIRE || renderMethod == RENDER_WIRE_VERTEX || renderMethod == RENDER_FILL_TRIANGLE_WIRE || renderMethod == RENDER_TEXTURED_WIRE {
			drawTriangle(
				int32(triangle.points[0].x()), int32(triangle.points[0].y()), // vertex A
				int32(triangle.points[1].x()), int32(triangle.points[1].y()), // vertex B
				int32(triangle.points[2].x()), int32(triangle.points[2].y()), // vertex C
				0xFFFFFFFF,
			)
		}

		// Draw triangle vertex points
		if renderMethod == RENDER_WIRE_VERTEX {
			drawRect(int32(triangle.points[0].x())-3, int32(triangle.points[0].y())-3, 6, 6, 0xFFFF00FF) // vertex A
			drawRect(int32(triangle.points[1].x())-3, int32(triangle.points[1].y())-3, 6, 6, 0xFFFF00FF) // vertex B
			drawRect(int32(triangle.points[2].x())-3, int32(triangle.points[2].y())-3, 6, 6, 0xFFFF00FF) // vertex C
		}
	}

	// Finally draw the color buffer to the SDL window
	renderColorBuffer()
}

// Clean up SDL
func destory() {
	renderer.Destroy()
	window.Destroy()
	sdl.Quit()
}

// Main function
func main() {
	isRunning = initial()

	if err := setup(); err != nil {
		log.Fatalf("%#v", err)
	}

	for isRunning {
		processInput()
		update()
		render()
	}

	defer destory()
}

func BytesToUint32s(bytes []byte) []uint32 {
	if len(bytes)%4 != 0 {
		panic("bytes length is not a multiple of 4")
	}

	uint32s := make([]uint32, len(bytes)/4)
	for i := range uint32s {
		uint32s[i] = order.Uint32(bytes[i*4 : (i+1)*4])
	}
	return uint32s
}

func chooseByteOrder() binary.ByteOrder {
	b := uint16(0xff)                      // one byte
	if *(*byte)(unsafe.Pointer(&b)) == 0 { // in big-endian, msb would be stored at the lowest memory address, the 0xff value has been "truncated" to 0x00
		return binary.BigEndian
	} else {
		return binary.LittleEndian
	}
}
